              "notes" : "The Employment Allowance was introduced in April 2014 and provided eligible employers with a reduction of up to £2,000 in their National Insurance contributions (NICs) which they pay on their employees. In April 2016, the allowance rose to £3,000. The allowance is available to business, charities, amateur sports clubs and, from April 2015, domestic employers of care and support workers. However, from April 2016 limited companies where the director is the only employee paid earnings above the Secondary Threshold for Class 1 National Insurance contributions have no longer been able to claim the allowance.",
